import styled from "@emotion/styled";

const FooterContainer = styled.div`
  height: 30rem;
  background: black;
  color: white;
  display: grid;
  grid-template-columns: 1fr 1fr 1fr;
`;

export const Footer = () => {
  return <FooterContainer></FooterContainer>;
};
